import Video from './components/Video'
import "./App.css"

function App() {

  let videos = [{
    title: "Node JS tutorials",
    views: "100K",
    time: "2 months ago",
    channel: "coder dost",
    verified: true
  },
  {
    title: "Express JS tutorials",
    views: "400K",
    time: "2 years ago",
    channel: "coder dost",
    verified: false
  },
  {
    title: "Django tutorials",
    views: "1M",
    time: "3 months ago",
    channel: "coder dost",
    verified: false
  },
  {
    title: "React tutorials",
    views: "50K",
    time: "7 months ago",
    channel: "coder dost",
    verified: true
  }
];

  return (
    <div className="App">
      <div>Videos</div>
      {
        videos.map(video=><Video
          title="Mongo DB tutorials"
          views="8K"
          time="5 days ago"
          channel="coder dost"
          verified={false}
          >
        </Video>)
      }
    </div>
  )
}

export default App;
